DROP TABLE IF EXISTS users;
CREATE TABLE IF NOT EXISTS users (
  id SERIAL NOT NULL,
  title VARCHAR(100) NOT NULL,
  name VARCHAR(100) NOT NULL,
  gender VARCHAR(10) NOT NULL,
  nin VARCHAR(20) NOT NULL,
  dob TIMESTAMP(0) WITH TIME ZONE NOT NULL,
  games VARCHAR(300) NULL,
  blood_type VARCHAR(100) NULL,
  car_id INT NULL,
  PRIMARY KEY (id));



DROP TABLE IF EXISTS user_contact;
CREATE TABLE IF NOT EXISTS user_contact (
  id SERIAL NOT NULL,
  user_id INT NOT NULL,
  phone_number VARCHAR(20) NOT NULL,
  email_address VARCHAR(100) NOT NULL,
  company_email_address VARCHAR(100) NULL,
  company_code VARCHAR(10) NULL,
  company_name VARCHAR(100) NULL,
  job_title VARCHAR(50) NULL,
  lorem TEXT NOT NULL,
  PRIMARY KEY (id),
  CONSTRAINT user_contact_fkey_user_id
    FOREIGN KEY (user_id)
    REFERENCES users (id));

CREATE INDEX user_contact_fkey_user_id_idx ON user_contact (user_id ASC);



DROP TABLE IF EXISTS user_address;
CREATE TABLE IF NOT EXISTS user_address (
  id SERIAL NOT NULL,
  user_id INT NOT NULL,
  state VARCHAR(100) NOT NULL,
  building_number VARCHAR(10) NOT NULL,
  city VARCHAR(100) NOT NULL,
  street_name VARCHAR(100) NOT NULL,
  post_code VARCHAR(10) NOT NULL,
  country VARCHAR(100) NOT NULL,
  latitude DECIMAL(10,6) NOT NULL,
  longitude DECIMAL(10,6) NOT NULL,
  PRIMARY KEY (id),
  CONSTRAINT user_address_fkey_user_id
    FOREIGN KEY (user_id)
    REFERENCES users (id));

CREATE INDEX user_address_fkey_user_id_idx ON user_address (user_id ASC);



DROP TABLE IF EXISTS transactions;
CREATE TABLE IF NOT EXISTS transactions (
  id SERIAL NOT NULL,
  user_id INT NOT NULL,
  item_name VARCHAR(100) NOT NULL,
  base_price INT NOT NULL,
  price INT NOT NULL,
  discount INT NOT NULL,
  tax INT NOT NULL,
  PRIMARY KEY (id),
  CONSTRAINT transactions_fkey_user_id
    FOREIGN KEY (user_id)
    REFERENCES users (id));

CREATE INDEX transactions_fkey_user_id_idx ON transactions (user_id ASC);



DROP TABLE IF EXISTS car_brand;
CREATE TABLE IF NOT EXISTS car_brand (
  id SERIAL NOT NULL,
  brand VARCHAR(100) NOT NULL,
  country VARCHAR(100) NOT NULL,
  PRIMARY KEY (id));



DROP TABLE IF EXISTS cars;
CREATE TABLE IF NOT EXISTS cars (
  id SERIAL NOT NULL,
  car_brand_id INT NOT NULL,
  name VARCHAR(100) NOT NULL,
  year INT NOT NULL,
  PRIMARY KEY (id),
  CONSTRAINT cars_fkey_car_brand_id
    FOREIGN KEY (car_brand_id)
    REFERENCES car_brand (id));

CREATE INDEX cars_fkey_car_brand_id_idx ON cars (car_brand_id ASC);



DROP TABLE IF EXISTS user_job;
CREATE TABLE IF NOT EXISTS user_job (
  id SERIAL NOT NULL,
  user_id INT NOT NULL,
  title VARCHAR(100) NOT NULL,
  salary INT NOT NULL,
  PRIMARY KEY (id),
  CONSTRAINT user_job_fkey_user_id
    FOREIGN KEY (user_id)
    REFERENCES users (id));

CREATE INDEX user_job_fkey_user_id_idx ON user_job (user_id ASC);

